pon will not be applied to items that have sale prices.'=>'Jei pasirinksite šį nustatymą, ši nuolaida nebus taikoma produktams su akcijinėmis kainomis.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Jei keičiate WooCommerce veikimą per tėvinę temą, kurios kūrėjas nesate Jūs pats, rekomenduojame naudoti potemes. Daugiau infomacijos: <a href="%s" target="_blank">How to create a child theme</a>','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Jei šablono failą nukopijavote ir įsidėjote savo pakeitimams atlikti, tuomet Jums reikia nukopijuoti naują to paties šablono versiją, joje vėl įdėti savo pakeitimus ir naudoti šį naują failą.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jei susikursite paskyrą, mes išsaugosime Jūsų vardą, el. paštą ir telefono numerį, kurie bus naudojami užsakymų apmokėjimo informacijai sukurti.','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Jei nurodysite Taisyklių ir sąlygų puslapį, prieš atsiskaitant pirkėjas bus paprašytas su jomis sutikti.','If you didn\'t make this request, just ignore this email. If you\'d like to proceed:'=>'Jei tokio prašymo nepateikėte, tiesiog ignoruokite šį laišką. Jei norite tęsti:','If you find a bug within WooCommerce core you can create a ticket via <a href="%1$s">GitHub issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'Jei radote klaidą pačiame WooCommerce, galite sukurti klaidos pranešimą per <a href="%1$s">Github</a>. Įsitikinkite, kad per