sia užsakymo suma, būtina norint pasinaudoti šiuo nuolaidos kodu yra %s.','The name of the current active theme.'=>'Šiuo metu aktyvios temos pavadinimas','The name of the parent theme.'=>'Tėvinės temos pavadinimas','The number of decimal points shown in displayed prices.'=>'Kiek dešimtųjų tikslumu rodomos kainos','The object cannot be deleted.'=>'Objekto ištrinti negalima.','The object does not support trashing. Set \'%s\' to delete.'=>'Objektas nepalaiko perkėlimo į šiukšlinę. Nustatykite  \'%s\' norėdami ištrinti.','The object has already been trashed.'=>'Objektas jau buvo perkeltas į šiukšlinę.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Galimi nustatymai yra &quot;Aktyvus&quot; (delivers payload), &quot;Sustabdytas&quot; (does not deliver), or &quot;Išjungtas&quot; (does not deliver due delivery failures).','The order ID.'=>'Užsakymo ID.','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'Užsakymo suma atnaujinta. Paspauskite mygtuką „Apmokėti“ esantį šiek tiek žemiau.','The parent theme developers URL.'=>'Tėvinės temos kūrėjų URL','The payment gateway for this order does not exist.'=>'Šiam užsakymui nėra apmokėjimo tarpininko','The payment gateway for this order does not support automatic refunds.'=>'Šiam užsakymui apmokėti panaudotas mokėjimų tarpininkas nepalaiko automatinių grąžinimų.','The position of the currency symbol.'=>'Piniginio vieneto simbolio vieta','The postal code, if any, in which your business is located.'=>'Jūsų verslo pašto kodas (jei toks yra).','The product review cannot be deleted.'=>'Atsiliepimas apie produktą negali būti ištrintas.','The product review does not support trashing.'=>'Produktų atsiliepimai negali būti ištrinti.','The provided handler %1$s does not implement %2$s.'=>'The provided handler %1$s does not implement %2$s.','The resource cannot be deleted.'=>'Išteklių negalima ištrinti.','The root URL of your site.'=>'Jūsų tinklalapio domeno URL.','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Akcija prasidės nustatytos "Nuo" datos 00:00:00 laiku ir baigsis nustatytos "Iki" datos 23:59:59 laiku.','The secret key is used to generate a hash of the delivered webhook and provided in the request headers.'=>'Slaptas raktas naudojamas generuoti kriptografinėms įvykdyto webhook\'o žymoms, jis taip pat pateikiamos užklausos antraštėse. ','The settings of this image size have been disabled because its values are being overwritten by a filter.'=>'Šio paveikslėlio dydžio nustatymai yra išjungti, kadangi jų reikšmes kontroliuoja filtras.','The status of the note (e.g. unactioned, actioned).'=>'Pastabos statusas (nevykdoma, įvykdyta).','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Likutis neatnaujintas nes jo reikšmė pasikeitė redaguojant produktą. Produkto %1$d atsargos dabar yra: %2$d.','The street address for your business location.'=>'Adresas, kur įsikūręs Jūsų verslas.','The text to appear in the footer of all WooCommerce emails.'=>'Tekstas, kuris bus rodomas visų WooCommerce el. laiškų apačioje.','The theme developers URL.'=>'Temos kūrėjo URL','The thousand separator of displayed prices.'=>'Rodomų kainų tūkstančių skirtukas','The unit lengths are defined in for this country.'=>'Ilgio vienetai nustatyti šiai šaliai.','The unit weights are defined in for this country.'=>'Matavimo vienetai yra priskirti šiai šaliai.','The URL of your %s page (along with the Page ID).'=>'Jūsų %s puslapio nuoroda (kartu su puslapio ID).','The version of cURL installed on your server.'=>'cURL, įdiegto jūsų serveryje, versija.','The version of MySQL installed on your hosting server.'=>'Jūsų serverio MySQL versija','The version of PHP installed on your hosting server.'=>'Jūsų serverio PHP versija.','The version of WooCommerce installed on your site.'=>'WooCommerce versija, kurią naudojate.','The version of WordPress installed on your site.'=>'WordPress versija, kurią naudojate.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Įskiepis WooCommerce Helper daugiau nebereikalingas. <a href="%s">Valdykite savo pirkinius</a> nuėję į Pirkinių skiltį.','The WooCommerce REST API allows external apps to view and manage store data. Access is granted only to those with valid API keys.'=>'WooCommerce REST API suteikia išorinėms programoms teises peržiūrėti ir valdyti Jūsų parduotuvės duomenis. Prieiga suteikiama tik programoms su galiojančiais API raktais.','Theme'=>'Tema','Theme author URL.'=>'Temos autoriaus nuoroda','Theme installation message.'=>'Temos diegimo pranešimas.','Theme installation status.'=>'Temos diegimo statusas.','Theme name.'=>'Temos pavadinimas','Theme status.'=>'Temos statusas.','Theme version.'=>'Temos versija','Theme.'=>'Tema.','There are currently no logs to view.'=>'Šiuo metu nėra log\'ų.','There are no currencies matching these parameters.'=>'Nėra valiutų kurios atitiktų šiuo parametrus.','There are no locations matching these parameters.'=>'Nėra vietovių kurios atitiktų šiuos parametrus.','There are no notes yet.'=>'Kol kas pastabų nėra.','There are no product reviews yet.'=>'Atsiliepimų apie produktus dar nėra.','There are no reviews yet.'=>'Atsiliepimų dar nėra.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Jūsų adresui nerasta pristatymo būdų. Įsitikinkite, kad įvedėte savo adresą teisingai, arba susisiekite su mumis jei reikia pagalbos.','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'Apmokėjimas kol kas negalimas, grįžkite į krepšelį ir pakeiskite nurodytas prekes ar jų kiekius.','There was a failure fetching this action'=>'Bandant gauti šį veiksmą įvyko klaida','There was an error calling %1$s: %2$s'=>'Įvyko klaida kviečiant %1$s: %2$s','There was an error calling %s'=>'Įvyko klaida kviečiant %s','There was an error calling this tool. There is no callback present.'=>'Įvyko klaida vykdant šią komandą. Nėra nurodytos grąžinimo funkcijos.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Šie kaštai gali papildomai būti pridėti pagal <a href="%s">produkto pristatymo klasę</a>.','These options let you change the appearance of the WooCommerce checkout.'=>'Šie nustatymai leidžia pakeisti WooCommerce apmokėjimo puslapio išvaizdą.','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Šie puslapiai turi būti nustatyti, kad WooCommerce žinotų, kur nukreipti pirkėją susimokėti.','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Pridėtiniai tarifai yra papildomos pristatymo sąlygos, kurios sąlygoja papildomus kaštus (lyginant su fiksuotu tarifu).','Thessaly'=>'Thessaly','Things to do next'=>'Ką daryti toliau','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Šis veiksmas neatšaukiamas. Ar tikrai norite ištrinti asmeninius duomenis iš pasirinktų užsakymų?','This controls how stock quantities are displayed on the frontend.'=>'Čia nustatoma, kaip atsargų kiekis rodomas pirkėjams.','This controls the description which the user sees during checkout.'=>'Tai aprašymas, kurį pirkėjas matus atsiskaitydamas.','This controls the position of the currency symbol.'=>'Čia nustatoma piniginio vieneto simbolio pozicija lyginant su kaina.','This controls the title which the user sees during checkout.'=>'Čia nustatomas pavadinimas, kurį pirkėjas mato atsiskaitydamas.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Čia nustatomas piniginis vienetas, kuriuo rodomos kainos ir kuris bus pateikiamas apmokėjimo tarpininkams.','This controls what unit you will define lengths in.'=>'Čia nustatomi ilgio vienetai.','This controls what unit you will define weights in.'=>'Čia nustatomi svorio vienetai.','This controls which shipping address is used by default.'=>'Čia nustatoma kuris pirkėjo adresas bus naudojamas.','This coupon has expired.'=>'Ši nuolaida jau nebegalioja.','This data will be deleted in %s.'=>'Šie duomenys bus ištrinti %s.','This email address is already registered.'=>'Pirkėjas su tokiu el.pašto adresu jau egzistuoja.','This field allows you to set the maximum spend (subtotal) allowed when using the coupon.'=>'Čia galite nustatyti, kokia turi būti didžiausia krepšelio vertė šiai nuolaidai panaudoti.','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'Čia galite nustatyti, kokia turi būti mažiausia krepšelio vertė šiai nuolaidai panaudoti.','This function should not be called before plugins_loaded.'=>'This function should not be called before plugins_loaded.','This function should not be called before woocommerce_init.'=>'Ši funkcija neturėtų būti iškviečiama anksčiau nei woocommerce_init.','This info will be displayed on the product page, category pages, social media, and search results.'=>'Šie duomenys bus matomi produkto puslapyje, kategorijų puslapiuose, socialinės medijos pasidalinimuose ir interneto paieškos rezultatuose.','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Tai bandomoji parduotuvė, skirta tik testuoti &mdash; užsakymai nebus vykdomi.','This is a featured product'=>'Tai rekomenduojamas produktas','This is an order notification sent to customers containing order details after payment.'=>'Tai pranešimas pirkėjui, siunčiamas po apmokėjimo; jame pateikiama visa užsakymo informacija.','This is not your download link.'=>'Tai nėra Jūsų atsisiuntimo nuoroda.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Failo ID arba paveikslėlio URL - rodoma produktuose kurie neturi įkeltos nuotraukos.','This is the default category and it cannot be deleted. It will be automatically assigned to products with no category.'=>'Tai yra numatytoji kategorija ir ji negali būti ištrina. Ji automatiškai naudojama visiems produktams kurie nepriskirti jokiai kitai kategorijai.','This is the name of the download shown to the customer.'=>'Tai yra pirkėjui rodomas failo pavadinimas','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'Tai eilutės "Pristatymas" suma iš visų užsakymų','This is the sum of the "Tax rows" tax amount within your orders.'=>'Tai eilutės "Mokesčiai" suma iš visų užsakymų','This is the sum of the \'Order total\' field within your orders.'=>'Tai bendra visų užsakymų galutinė suma.','This is the sum of the \'Shipping total\' field within your orders.'=>'Tai bendra pristatymo kainos suma.','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'Tai bendra užsakymų suma, atėmus visus grąžinimus bei atskaičiavus pristatymo kainą ir mokesčius.','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'Tai bendra užsakymų suma, atėmus visus grąžinimus bei priskaičiavus pristatymo kainą ir mokesčius.','This is the total tax for the rate (shipping tax + product tax).'=>'Tai bendra šio tarifo mokesčių suma (pristatymo mokestis + produkto mokestis).','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'Tai nuoroda ar kelias iki failo (absolute path), kurį gaus pirkėjai. Įvestos nuorodos jau turi būti užkoduotas (encoded).','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'Tai WooCommerce parduotuvės puslapis. Šis puslapis rodo visus Jūsų produktus. <a href="%s">Daugiau informacijos</a>.','This is where store orders are stored.'=>'Čia saugomi parduotuvės užsakymai.','This is where you can add new coupons that customers can use in your store.'=>'Čia galite sukurti naujus nuolaidų kodus, kuriuos pirkėjai galės panaudoti Jūsų parduotuvėje.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Tai vietovė, kur įkurtas Jūsų verslas. Šis adresas reikalingas mokesčių tarifams ir pristatymo kainoms apskaičiuoti.','This key is invalid or has already been used. Please reset your password again if needed.'=>'Šis raktas neteisingas arba jau buvo panaudotas. Pradėkite slaptažodžio atstatymą iš naujo, jei to vis dar reikia.','This lets you choose which products are part of this group.'=>'Tai leidžia jums pasirinkti, kurie produktai yra šios grupės dalis.','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'Šis pristatymo būdas nebenaudojamas nuo 2.6.0 versijos ir naujose versijose bus pašalintas - rekomenduojame jį išjungti ir vietoje jo sukonfigūruoti naują pristatymo mokestį konkrečioje <a href="%s">Pristatymo zonoje</a>.','This method should not be called before plugins_loaded.'=>'This method should not be called before plugins_loaded.','This month'=>'Šis mėnuo','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'Šis nustatymas lemia numatytąją pirkėjo vietovę. Pasirinkus geolokacijos nustatymą, MaxMind GeoLite duomenų bazė bus periodiškai atsiunčiama ir išsaugoma tinklalapio wp-content aplanke.','This option determines which address is used to calculate tax.'=>'Čia nustatoma, kuris adresas naudojamas mokesčiams apskaičiuoti.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Ši nustatymas yra svarbus, nes paveikia kainų įvedimą. Pakeitimas neatnaujins esamų produktų.','This option lets you limit which countries you are willing to sell to.'=>'Šis nustatymas leidžia pasirinkti, kuriose šalyse vykdysite veiklą.','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Šis pasirinkimas ištrins VISUS Jūsų mokesčių tarifus, naudokite atsargiai. Šis veiksmas neatstatomas.','This order cannot be paid for. Please contact us if you need assistance.'=>'Šio užsakymo apmokėti negalima. Jei reikia pagalbos, susisiekite su mumis.','This order is no longer editable.'=>'Šio užsakymo redaguoti nebegalima.','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'Šio užsakymo&rsquo;s statusas yra &ldquo;%s&rdquo;&mdash;apmokėjimas negalimas. Prašome susisiekti su administracija, jei Jums reikia pagalbos.','This password reset key is for a different user account. Please log out and try again.'=>'Šis slaptažodžio nustatymo iš naujo raktas skirtas kitai vartotojo paskyrai. Atsijunkite ir bandykite dar kartą.','This payment method was successfully set as your default.'=>'Apmokėjimo būdas sėkmingai nustatytas numatytuoju.','This product cannot be added to the cart.'=>'Šio produkto negalima įdėti į krepšelį.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Šis produktas buvo parduotas praeityje ir gali būti susijęs su egzistuojančiais užsakymais. Ar tikrai norite jį ištrinti?','This product is currently out of stock and unavailable.'=>'Produkto šiuo metu neturime.','This product is protected and cannot be purchased.'=>'Šis produktas neparduodamas.','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Ataskaitos nuoroda negalioja. %1$sPaspauskite čia ir peržiūrėkite filtruotą ataskaitą%2$s.','This resource cannot be created.'=>'Toks šaltinis negali būti sukurtas.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Šis labai paprastas pavyzdys apima tik pagrindinę informaciją apie asmeninius duomenis kuriuos Jūsų parduotuvė gali rinkti, saugoti ir perduoti; bei kas gali šiuos duomenis matyti. Priklausomai nuo nustatymų bei kitų naudojamų įskiepių, konkretūs saugomi asmens duomenys gali būti skirtingi kiekvienoje parduotuvėje. Sudarant savo parduotuvės privatumo politiką rekomenduojame konsultuotis su teisininkais.','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Privatumo politikos nustatymai. Žemiau matomos žinutės nebus rodomos kol nenustatytas privatumo politikos puslapis.','This section lets you customize the WooCommerce emails. <a href="%s" target="_blank">Click here to preview your email template</a>.'=>'Čia galite keisti WooCommerce siunčiamų laiškų išvaizdą. <a href="%s" target="_blank">Spauskite čia norėdami peržiūrėti dabartinį šabloną</a>.','This section shows any files that are overriding the default WooCommerce template pages.'=>'Čia rodomi failai, kuriais perrašomi numatytieji WooCommerce šablonai.','This sets the base page of your shop - this is where your product archive will be.'=>'Tai bazinis parduotuvės puslapis - čia bus jūsų produktų archyvas.','This sets the decimal separator of displayed prices.'=>'Nustato, kaip vaizduojant kainas atskiriami centai.','This sets the number of decimal points shown in displayed prices.'=>'Nustato, kiek skaičių kainose rodyti po kablelio.','This sets the thousand separator of displayed prices.'=>'Nustato, kaip vaizduojant kainas atskiriami tūkstančiai.','This setting determines which shop pages products will be listed on.'=>'Šis nustatymas nurodo, kuriuose parduotuvės puslapiuose bus rodomi produktai.','This setting does not apply to guest purchases.'=>'Šis nustatymas netaikomas svečiams.','This shipping method does not have any settings to configure.'=>'Šis pristatymo būdas neturi papildomų nustatymų.','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'Šį prenumerata baigėsi. Susisiekite su savininku ir <strong>atnaujinkite</strong> prenumeratą, kad galėtumėte gauti atnaujinimus ir pagalbą.','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'Šį prenumerata baigėsi. <strong>Atnaujinkite</strong> prenumeratą, kad galėtumėte gauti atnaujinimus ir pagalbą.','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'Šį prenumerata greitai baigsis. <strong>Atnaujinkite</strong> prenumeratą, kad galėtumėte gauti atnaujinimus ir pagalbą.','This template has been overridden by your theme and can be found in: %s.'=>'Šį šabloną valdo Jūsų tema, jis gali būti rastas : <code>%s</code>.','This text will be shown on the button linking to the external product.'=>'Šis tekstas bus rodomas ant mygtuko, vedančio į išorinį produktą.','This tool allows you to generate and download a CSV file containing a list of all products.'=>'Šis įrankis skirtas sukurti ir atsisiųsti CSV failą, kuriame yra visų produktų sąrašas.','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'Šis įrankis importuoja (arba apjungia) produktų duomenis į Jūsų parduotuvę iš CSV arba TXT failo.','This tool will clear ALL expired transients from WordPress.'=>'Šis įrankis išvalys VISUS nebegaliojančius WordPress laikinus duomenis.','This tool will clear the product/shop transients cache.'=>'Šis įrankis išvalys produkto/parduotuvės