oducts > Inventory.'=>'Kai produkto atsargos pasieks šį kiekį, Jums bus pranešta el. paštu. Šis kiekis gali būti skirtingas kiekvienam variantui atskirai. Visiems vienodas kiekis gali būti nustatytas WooCommerce > Nustatymai > Produktai > Atsargos.','When product stock reaches this amount you will be notified via email.'=>'Kai produkto atsargos pasieks šį kiekį, Jums bus pranešta el. paštu.','When true, the payment gateway API is used to generate the refund.'=>'Kai pažymėta, grąžinimui sukurti naudojamas mokėjimo būdo API.','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Kai produkto varianto atsargos pasieks šį kiekį, Jums bus pranešta el. paštu. Vienodas visiems variantams kiekis gali būti nustatytas produkto nustatymuose, eilutėje Atsargos. Visiems produktams vienodas kiekis gali būti nustatytas WooCommerce > Nustatymai > Produktai > Atsargos.','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kai perkate mūsų parduotuvėje, turite pateikti informaciją, tokią kaip Jūsų vardas ir pavardė, adresas, pristatymo adresas, el.paštas, telefonas, mokėjimui reikalinga informacija ir pasirinktas paskyros vartotojo vardas bei slaptažodis. Šią informaciją mes naudosime tokiems tikslams:','When you receive a new order, it will appear here.'=>'Kai gausite naują užsakymą, jis pasirodys čia.','Where is your store based?'=>'Kur įsikūrusi jūsų parduotuvė?','Whether or not this is a compound rate.'=>'Pasirinkite, ar tai sudėtinis mokestis, pritaikomas ir visiems kitiems jau esamiems mokesčiams.','Whether or not this tax rate also gets applied to shipping.'=>'Ar šis moke